import React from "react";
import styled from "styled-components";
import MainContainer from "../components/MainContainer";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 30px 20px;
  background-color: #fff;
`;

const MapContainer = styled.div`
  width: 100%;
  height: 300px;
  background-color: #e0e0e0;
  border-radius: 20px;
  position: relative;
  overflow: hidden;

  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
`;

const DateTime = styled.p`
  margin: 10px 0;
  font-size: 16px;
  color: #555;
`;

const Title = styled.h1`
  margin-top: 15px;
  text-align: center;
  font-size: 30px;
  font-weight: 500;
`;

const RunningTitle = styled.h1`
  margin: 10 0;
  text-align: center;
  font-size: 30px;
  font-weight: 500;
`;

const Button = styled.button`
  padding: 12px 20px;
  background-color: #4ed0b0;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  font-size: 16px;

  &:hover {
    background-color: #3abf9a;
  }
`;

const Running = () => {
  return (
    <MainContainer>
      <Title>러닝 정보</Title>
      <Container>
        <MapContainer>
          <img src="../../img/ex_map.png" alt="지도" />
        </MapContainer>
        <DateTime>24.10.28 / 20:00</DateTime>
        <RunningTitle>중량천 만보런</RunningTitle>
        <Button>참여하기</Button>
      </Container>
    </MainContainer>
  );
};

export default Running;
